export default function Main() {
  
  let list = [
    {productName: 'Shoes', price: 100, url: 'https://via.placeholder.com/600/bada55?text=Shoes'},
    {productName: 'Jacket', price: 200, url: 'https://via.placeholder.com/600/bada55?text=Shoes'},
    {productName: 'Jeans', price: 150, url: 'https://via.placeholder.com/600/bada55?text=Jeans'},
    {productName: 'Shirt', price: 190, url: 'https://via.placeholder.com/600/bada55?text=Shoes'},
  ]

  return (
    <div className='container d-flex flex-wrap gap-3 mt-4'>
      {
        list.map((product) => ( 
          <div className="card" style={{width:'300px'}}>
            <img className="card-img-top" src="https://via.placeholder.com/300" alt="Title" />
            <div className="card-body">
              <h4 className="card-title">{product.productName}</h4>
              <p className="card-text">{product.price}</p>
            </div>
          </div>
        ))
      }
    </div>
  )
}
